import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card'
import Cdata from './Cdata'




ReactDOM.render(

   <>

    <h1> Welcome to a demonstation of a React App</h1>
    <div className="card_container">



    {Cdata.map((val) => {
            return(
                <Card 
                isc={val.isc}
                titel={val.titel}
                txt={val.txt}
                />
            );
    })}


    </div>

    </>,
    document.getElementById('root')
);
